body:
This change enables creating OrtValues from ID3D12Resources from the onnxruntime C-API. This allows people to bind GPU resources without copying back to CPU in the OnnxRuntime C-API. This was previously only achievable in the WinML WinRT API projection.

The change enables the creation of OrtValues from the platform specific `ID3D12Resource` currency by exposing a mechanism for Execution Provider specific APIs. These APIs allow DML to extend the C-API and provide EP specific extensions. Among these extensions are the following new APIs:

```
  ORT_API2_STATUS(OrtSessionOptionsAppendExecutionProviderEx_DML, _In_ OrtSessionOptions* options,
                  _In_ IDMLDevice* dml_device, _In_ ID3D12CommandQueue* cmd_queue);
  ORT_API2_STATUS(DmlCreateGPUAllocationFromD3DResource, _In_ ID3D12Resource* d3d_resource,
                  _Out_ void** dml_resource);
  ORT_API2_STATUS(DmlFreeGPUAllocation, _In_ void* dml_resource);
  ORT_API2_STATUS(DmlGetD3D12ResourceFromAllocation, _In_ OrtAllocator* provider, _In_ void* dml_resource,
                  _Out_ ID3D12Resource** d3d_resource);
...
```
  
 The WinML WinRT API has been refactored to make use of these new APIs and discard the corresponding private implementations that already existed in the `WinMLAdapter` API used by WinML.
